define("validate",["underscore","log"],function(i,n){return function(n){if(i.has(n,"Validation")){if(!1===i.isArray(n.Validation))throw{message:"Error: Validation type was not array!"};if(!1===i.every(n.Validation,function(n){return i.isFunction(n)})&&!1===i.isEmpty(n.Validation))throw{message:"Error: Validation element type was not function!"};return i.every(n.Validation,function(i){return i(n.Data)})}}});